css:
/* Theme adjustments */
.theme-atom-light-ui atom-panel.modal.expose-panel {
  background-color: rgba(255, 255, 255, 0.4);
}
.theme-one-light-ui atom-panel.modal.expose-panel,
.theme-one-dark-ui atom-panel.modal.expose-panel {
  background-color: inherit;
}
.theme-one-light-ui atom-panel.modal.expose-panel::before,
.theme-one-dark-ui atom-panel.modal.expose-panel::before {
  opacity: 0;
}
.theme-atom-material-ui atom-panel.modal.overlay.from-top {
  padding: 10px;
}
.theme-atom-material-ui .expose-view .tab-body,
.theme-atom-material-ui .expose-view .tab-header {
  background-color: #e8e8e8;
}
.theme-native-ui atom-panel.modal.expose-panel {
  top: 0 !important;
}
